import React from 'react';
import {View,Text,TouchableOpacity,Button,SafeAreaView} from 'react-native';
import {css} from '../assets/Css/css';

export default function Home (props1) {
   
    return (
            <View style = {css.container2}>
                <TouchableOpacity title = "Ir para Preditor1" onPress={()=>props1.navigation.navigate('Preditor1')} style = {css.button1}>Preditor</TouchableOpacity>
                <TouchableOpacity title = "Ir para Teste1" onPress={()=>props1.navigation.navigate('Teste1')} style = {css.button2}>Teste</TouchableOpacity>
            </View>
    );
    
}
